function App() {
  return (
    <div className="container mx-auto p-4">
      <Header />
      <Switch>
        <Route path="/" exact component={MemeList} />
        <Route path="/meme/:id" component={MemeCard} />
      </Switch>
      <Footer />
    </div>
  );
}

export default App;
